def deeksha_solution(arr):
    import math
    max_ele = 0
    for i in range(len(arr)):
        max_ele = max(max_ele, arr[i])
        arr[i] = math.gcd(max_ele, arr[i])
    arr.sort()
    groups = []
    for i in range(len(arr) // 2):
        groups.append([arr[i], arr[len(arr) - 1 - i]])
